import React , { useState} from "react";





function Signup(){


  return (
    
    <div id={"forgot-page"}>
    <div id={"forgot-header"}>
        <div id={"forgot-backButton"}>
            <a href={"/login"}
               className={"arrow left"}>
            </a>
        </div>

        <div id={"forgot-forgotPasswordText"}>
            <h3> Forgot password </h3>
        </div>
    </div>
        <p id = "subtitle">Lorem ipsum dolor sit amet, consectetur adipiscing elit</p>
        <input id="Fullname" type="text" placeholder="Full Name" ></input><br></br>
        <input id="Email" type="text" placeholder="Email" ></input><br></br>
        <input id="Password" type="text" placeholder="Password" ></input><br></br>
        <input id="ConfirmPassword" type="text" placeholder="Confirm Password" ></input><br></br>
    </div>
      
      
  );

}

  
export default Signup;
